import { useParams } from "react-router-dom"

const ViewPatient = () => {
    const {id} = useParams()

    return (
        <div className='Body'>
        <DoctorPagesContent/>
            <div className='DATAPAGE'>
                <h1>{id}</h1>
            </div>
        </div>
    )
}

export default ViewPatient
